import React, { useEffect, useState } from 'react';
import axios from 'axios';
import config from '../config';

const HeartRatePlot = () => {
  const [plotUrl, setPlotUrl] = useState('');

  useEffect(() => {
    const fetchHeartRatePlot = async () => {
      try {
        const response = await axios.get(`${config.API_BASE_URL}/plot_heart_rate`);
        if (response.data && response.data.image) {
          setPlotUrl(`data:image/png;base64,${response.data.image}`);
        }
      } catch (error) {
        console.error('Error fetching heart rate plot:', error);
      }
    };

    fetchHeartRatePlot();
  }, []);

  return (
    <div>
      <h2>Heart Rate Plot</h2>
      {plotUrl ? (
        <img src={plotUrl} alt="Heart Rate Plot" />
      ) : (
        <p>Loading plot...</p>
      )}
    </div>
  );
};

export default HeartRatePlot;
